import Details from './pages/Details';
import Products from 'server/listings.json'; 
import './App.css';


class App extends Component{


  constructor(props){
    super(props);
    this.state = {
        prodList: [],
        store: []
    }
  }

  componentDidMount(){

    this.setState({prodList: Products })
  }

  render(){
    const {prodList} = this.state;

  return (
    <Router>
      <Switch>

        <Route path='/' exact component={Home} />
        {/* <Details path="/details/:productId" /> */}

        <Route exact path="/details/:productId" component={() => (
            < Details prodList={this.state.prodList} />
        )} />


      </Switch>
    {/* <Details path="/details/:productId" />
